import React, { useState } from 'react';
import './Feedback.css'; // Assuming you have a CSS file for styles

const Feedback = () => {
  const [feedback, setFeedback] = useState('');
  const [likeChecked, setLikeChecked] = useState(false);
  const [dislikeChecked, setDislikeChecked] = useState(false);

  const handleChange = (e) => {
    setFeedback(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log("Feedback submitted:", feedback, "Like:", likeChecked, "Dislike:", dislikeChecked);
  };

  return (
    <div className="container mt-10">
      <div className="row">
        <div className="col-md-8">
          <h2 className="text-left mb-4">Feedback</h2>

          <form onSubmit={handleSubmit}>
            <div className="form-group mb-3">
              <textarea
                className="form-control w-100"
                value={feedback}
                onChange={handleChange}
                placeholder="Enter your feedback here"
                required
                rows="6"
              />
            </div>

            {/* Like/Dislike Section */}
            <div className="like-dislike-container">
              <div className="tool-box">
                <button className="btn-close">×</button>
              </div>
              <p className="text-content">What did you think<br />of this post?</p>
              <div className="icons-box">
                <div className="icons">
                  <label className="btn-label" htmlFor="like-checkbox">
                    <span className="like-text-content">123</span>
                    <input
                      className="input-box"
                      id="like-checkbox"
                      type="checkbox"
                      checked={likeChecked}
                      onChange={() => {
                        setLikeChecked(!likeChecked);
                        if (dislikeChecked) setDislikeChecked(false); // Uncheck dislike if like is checked
                      }}
                    />
                    <svg className="svgs" id="icon-like-solid" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512">
                      <path d="M313.4 32.9c26 5.2 42.9 30.5 37.7 56.5l-2.3 11.4c-5.3 26.7-15.1 52.1-28.8 75.2H464c26.5 0 48 21.5 48 48c0 18.5-10.5 34.6-25.9 42.6C497 275.4 504 288.9 504 304c0 23.4-16.8 42.9-38.9 47.1c4.4 7.3 6.9 15.8 6.9 24.9c0 21.3-13.9 39.4-33.1 45.6c.7 3.3 1.1 6.8 1.1 10.4c0 26.5-21.5 48-48 48H294.5c-19 0-37.5-5.6-53.3-16.1l-38.5-25.7C176 420.4 160 390.4 160 358.3V320 272 247.1c0-29.2 13.3-56.7 36-75l7.4-5.9c26.5-21.2 44.6-51 51.2-84.2l2.3-11.4c5.2-26 30.5-42.9 56.5-37.7zM32 192H96c17.7 0 32 14.3 32 32V448c0 17.7-14.3 32-32 32H32c-17.7 0-32-14.3-32-32V224c0-17.7 14.3-32 32-32z"></path>
                    </svg>
                    <svg className="svgs" id="icon-like-regular" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512">
                      <path d ="M256 32C119 32 8 143 8 280c0 137 111 248 248 248s248-111 248-248C504 143 393 32 256 32zm0 448c-110.5 0-200-89.5-200-200S145.5 80 256 80s200 89.5 200 200-89.5 200-200 200zm-40-200c0-22.1 17.9-40 40-40s40 17.9 40 40-17.9 40-40 40-40-17.9-40-40z"></path>
                    </svg>
                  </label>
                </div>
                <div className="icons">
                  <label className="btn-label" htmlFor="dislike-checkbox">
                    <span className="dislike-text-content">45</span>
                    <input
                      className="input-box"
                      id="dislike-checkbox"
                      type="checkbox"
                      checked={dislikeChecked}
                      onChange={() => {
                        setDislikeChecked(!dislikeChecked);
                        if (likeChecked) setLikeChecked(false); // Uncheck like if dislike is checked
                      }}
                    />
                    <svg className="svgs" id="icon-dislike-solid" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512">
                      <path d="M198.6 479.1c-26-5.2-42.9-30.5-37.7-56.5l2.3-11.4c5.3-26.7 15.1-52.1 28.8-75.2H48c-26.5 0-48-21.5-48-48c0-18.5 10.5-34.6 25.9-42.6C15 236.6 8 223.1 8 208c0-23.4 16.8-42.9 38.9-47.1c-4.4-7.3-6.9-15.8-6.9-24.9c0-21.3 13.9-39.4 33.1-45.6c-.7-3.3-1.1-6.8-1.1-10.4c0-26.5 21.5-48 48-48h246.5c19 0 37.5 5.6 53.3 16.1l38.5 25.7C336 91.6 352 121.6 352 153.7V192 240 264.9c0 29.2-13.3 56.7-36 75l-7.4 5.9c-26.5 21.2-44.6 51-51.2 84.2l-2.3 11.4c-5.2 26-30.5 42.9-56.5 37.7zM480 320H416c-17.7 0-32-14.3-32-32V64c0-17.7 14.3-32 32-32h64c17.7 0 32 14.3 32 32v224c0 17.7-14.3 32-32 32z"></path>
                    </svg>
                  </label>
                </div>
              </div>
            </div>

            <button type="submit" className="btn btn-primary mt-3">Submit Feedback</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Feedback;
